import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">Nova</div>
      <ul className="nav-links">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/shop">Shop By</Link></li>
        <li><Link to="/contact">Contact</Link></li>
        <li>
          {/* Inline SVG icon */}
          <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 24 24"
            width="30" // Adjust size
            height="24" // Adjust size
            className="search-icon"
          >
            <path
              fill="none"
              d="M0 0h24v24H0z"
            />
            <path
              d="M10 2a8 8 0 0 0 0 16 8 8 0 0 0 0-16zm0 14a6 6 0 1 1 0-12 6 6 0 0 1 0 12zM22 22l-4.5-4.5"
            />
          </svg>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
